import { useState, useEffect } from "react";
import jsPDF from "jspdf";
import "jspdf-autotable";
import { Button, Box, Modal, Typography, Tooltip } from "@mui/material";
import { getReports } from "../api/endpoint";
import { jwtDecode } from "jwt-decode";

const PDFDesigner = () => {
  const [pdfUrl, setPdfUrl] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [reportData, setReportData] = useState([]);
  const [studentName, setStudentName] = useState("");

  useEffect(() => {
    const fetchReportData = async () => {
      try {
        const token = localStorage.getItem("token");
        if (token) {
          const decodedToken = jwtDecode(token);
          setStudentName(decodedToken.username);
          const response = await getReports(decodedToken.id);
          setReportData(response.data);
        }
      } catch (error) {
        console.error("Failed to fetch report data", error);
      }
    };

    fetchReportData();
  }, []);

  const generatePDF = () => {
    const doc = new jsPDF("p", "mm", "a4");

    const SourGummy =
      "";
    doc.addFileToVFS("SourGummy.ttf", SourGummy);
    doc.addFont("SourGummy.ttf", "SourGummy", "normal");

    const SchoolFont =
      "";
    doc.addFileToVFS("School.ttf", SchoolFont);
    doc.addFont("School.ttf", "School", "normal");

    const backgroundImage =
      "";

    // Data yang akan digunakan
    const dataSiswa = [{ Nama: "John Doe" }];

    // Mengambil data pertama dari array (karena hanya ada satu objek dalam contoh ini)
    const studentData = dataSiswa[0];
    const determineKeterangan = (nilai) => {
      if (nilai >= 90) return "Sangat Baik";
      if (nilai >= 80) return "Baik";
      if (nilai >= 70) return "Cukup Baik";
      return "Kurang Baik";
    };

    // ** Tambahkan Tabel Data **
    const data = [
      { id: 1, kelas: "Bahasa Indonesia", nilai: 80 },
      { id: 2, kelas: "Bahasa Inggris", nilai: 85 },
      { id: 3, kelas: "Agama Islam", nilai: 73 },
      { id: 4, kelas: "Matematika", nilai: 90 },
      { id: 5, kelas: "Ilmu Pengetahuan Alam", nilai: 88 },
      { id: 6, kelas: "Sejarah", nilai: 77 },
      { id: 7, kelas: "Pendidikan Pancasila dan Kewarganegaraan", nilai: 82 },
      { id: 8, kelas: "Ekonomi", nilai: 79 },
      { id: 9, kelas: "Sosiologi", nilai: 87 },
      { id: 10, kelas: "Fisika", nilai: 92 },
      { id: 11, kelas: "Kimia", nilai: 84 },
      { id: 12, kelas: "Biologi", nilai: 89 },
      { id: 13, kelas: "Geografi", nilai: 78 },
      { id: 14, kelas: "Seni Budaya", nilai: 83 },
      { id: 15, kelas: "Olahraga", nilai: 91 },
      { id: 16, kelas: "Teknologi Informasi", nilai: 86 },
      { id: 17, kelas: "Bahasa Arab", nilai: 75 },
      { id: 18, kelas: "Bahasa Jepang", nilai: 80 },
      { id: 19, kelas: "Tata Boga", nilai: 88 },
      { id: 20, kelas: "Pendidikan Jasmani", nilai: 93 },
    ].map((item) => ({
      ...item,
      peng: determineKeterangan(item.nilai),
    }));

    // Membagi data menjadi 10 data per halaman
    const pageData = [];
    for (let i = 0; i < data.length; i += 10) {
      pageData.push(data.slice(i, i + 10));
    }

    // Gambar tabel untuk setiap halaman
    pageData.forEach((page, pageIndex) => {
      if (pageIndex > 0) {
        doc.addPage();
      }

      doc.addImage(backgroundImage, "PNG", 0, 0, 210, 297); // Menambahkan gambar ke seluruh halaman (ukuran A4)

      // Tambahkan kotak dengan sudut membulat
      doc.setFillColor(255, 255, 255); // Warna putih untuk kotak
      doc.roundedRect(14, 10, 182, 250, 10, 10, "F"); // Kotak dengan isi (fill)

      doc.setFont("School");
      doc.setFontSize(60);
      doc.setTextColor(38, 130, 255);
      doc.text("RAPOT", 105, 35, { align: "center" });

      doc.addImage(
        "data:image/png;base64,",
        "PNG",
        15,
        8,
        30,
        37
      );

      doc.setFont("SourGummy");
      doc.setFontSize(15);
      doc.setTextColor(11, 81, 176);
      doc.text(`NAMA SISWA: ${studentName}`, 25, 55);

      const getGradeDescription = (grade) => {
        if (grade === 100) {
          return "Sempurna";
        } else if (grade > 90) {
          return "Sangat Baik";
        } else if (grade > 80) {
          return "Baik";
        } else if (grade > 70) {
          return "Cukup Baik";
        } else {
          return "Kurang Baik";
        }
      };

      const tableData = reportData.map((row, index) => [
        index + 1,
        row.class_name, // Nama kelas dari data yang di-fetch
        row.grade, // Nilai siswa
        getGradeDescription(row.grade), // Deskripsi nilai menggunakan fungsi
      ]);

      doc.autoTable({
        head: [["ID", "Kelas", "Nilai", "Keterangan"]],
        body: tableData,
        startY: 70,
        margin: { left: 20, right: 20 },
        tableWidth: 170,
        styles: {
          textColor: [2, 115, 181],
          font: "SourGummy",
          fontSize: 15,
          cellPadding: 3,
          lineColor: [38, 130, 255],
          lineWidth: 0.5,
          valign: "middle",
          minCellHeight: 15,
        },
        headStyles: {
          fillColor: [38, 130, 255],
          textColor: [255, 255, 255],
          fontStyle: "bold",
          halign: "center",
        },
        alternateRowStyles: {
          fillColor: [255, 255, 255],
        },
        columnStyles: {
          0: { halign: "center", font: "School" },
          2: { halign: "center", font: "School" },
        },
      });
    });

    // Tambahkan footer di semua halaman
    const pageCount = doc.internal.getNumberOfPages(); // Total halaman
    for (let pageIndex = 1; pageIndex <= pageCount; pageIndex++) {
      doc.setPage(pageIndex); // Beralih ke halaman tertentu
      doc.setFontSize(10);
      doc.text(`Halaman ${pageIndex} dari ${pageCount}`, 105, 290, {
        align: "center",
      });
    }

    // Pindahkan doc.save ke luar loop
    const pdfBlob = doc.output("blob");

    const pdfUrl = URL.createObjectURL(pdfBlob);
    setPdfUrl(pdfUrl);
    setIsModalOpen(true);
  };
  const handleCloseModal = () => {
    setIsModalOpen(false);
  };
  return (
    <div>
      <Tooltip title="Download the PDF file" arrow>
        <Button
          variant="contained"
          color="primary"
          onClick={generatePDF}
          sx={{
            backgroundColor: "#10AF13",
            "&:hover": { backgroundColor: "#0e8e11" },
            padding: "10px",
            fontSize: "16px",
          }}
        >
          Download PDF
        </Button>
      </Tooltip>

      <Modal open={isModalOpen} onClose={handleCloseModal}>
        <Box
          sx={{
            position: "absolute",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            width: "80%",
            bgcolor: "background.paper",
            borderRadius: "10px",
            boxShadow: 24,
            p: 4,
          }}
        >
          <Typography variant="h6" component="h2" sx={{ mb: 2 }}>
            PDF Preview
          </Typography>
          {pdfUrl && (
            <iframe
              src={pdfUrl}
              width="100%"
              height="500"
              style={{ border: "1px solid #ddd" }}
              title="Generated PDF"
            />
          )}
          <Button
            variant="contained"
            color="secondary"
            onClick={handleCloseModal}
            sx={{ mt: 2 }}
          >
            Close
          </Button>
        </Box>
      </Modal>
    </div>
  );
};

export default PDFDesigner;
